import React, { useState, useEffect } from "react";
import {
  View,
  StyleSheet,
  Pressable,
  Image,
  Text,
  VirtualizedList,
} from "react-native";
import Topnav from "../components/Topnav";
import Destyevents1 from "../components/Destyevents1";
import Snippet from "../components/snippet";
import { useNavigation } from "@react-navigation/native";
import { Color, Padding } from "../GlobalStyles";
import Search from "./search";
import { db } from "../firebase/firebase";
import { getFirestore, collection, doc, getDoc } from 'firebase/firestore';
import { batch, useDispatch, useSelector } from 'react-redux';
import PostsFetcher from "../src/store/firestoreQuery";



const Feed = ({ route }) => {
  const [flatListFlatListData, setFlatListFlatListData] = useState([
    { key: "1", component: <Destyevents1 /> },
    { key: "2", component: <Snippet /> },
    { key: "3", component: <Destyevents1 /> },
    { key: "4", component: <Destyevents1 /> },
    { key: "5", component: <Destyevents1 /> },

  ]);


// First the app loads the user profile
// Why i chose here is because the uid is passed to the feed page during redirect to this page
// I needed the user profile for several functions inside the app
// the uid passed after successul authentiction is used to fetch a profile from the database
// The user profile fetched from the database is then dispatched to a redux store for it to be globally accessible by other 
// screens and components of my app.
  const dispatch = useDispatch();
  const setUserProfileInRedux = (profile) => {
    dispatch({
      type: 'SET_USER_PROFILE',
      payload: profile,
    });
  };

  useEffect(() => {
    const uid = route?.params?.uid;

    if (!uid) {
      setUserProfileInRedux({
        username: '',
        profileImage: '',
        field: '',
      });
    } else {
      const fetchUserProfile = async () => {
        try {
          const userProfileDoc = doc(db, 'userProfiles', uid);
          const userProfileRef = await getDoc(userProfileDoc);

          if (!userProfileRef.exists) {
            console.log('User profile not found!');
          } else {
            const userProfileData = userProfileRef.data();
            setUserProfileInRedux({
              username: userProfileData.username,
              profileImage: userProfileData.profileImageUrl,
              field: userProfileData.field,
            });
          }
        } catch (error) {
          console.log('Error fetching user profile:', error);
        }
      };

      fetchUserProfile();
    }
  }, [route?.params?.uid]);
  const userProfile = useSelector(state => state.userProfile);
// Loading of the user profile ends here



// Loading of posts 
  const navigation = useNavigation();
  const [batchNumber, setBatchNumber] = useState(0);

   useEffect(() => {
    dispatch({
    type: "SET_BATCH_NUMBER",
    payload: batchNumber,
     });
     }, [batchNumber, dispatch]);

  function handleFetchMorePosts(){
    setBatchNumber(batchNumber + 1);
  }

  const getItemCount = (data) => data.length;
  const getItem = (data, index) => data[index];
  const renderVirtualizedItem = ({ item }) => item.component;

  return (
    <View style={[styles.feed, styles.feedFlexBox]}>
      <Topnav />
      <VirtualizedList
        showsVerticalScrollIndicator={false}
        data={flatListFlatListData}
        renderItem={renderVirtualizedItem}
        keyExtractor={(item) => item.key}
        getItemCount={getItemCount}
        getItem={getItem}
        onEndReached={handleFetchMorePosts}
        onEndReachedThreshold={0.5}
        contentContainerStyle={styles.flatListFlatListContent}
        ListHeaderComponent={<Search />}
      />
      <View style={[styles.bottomview, styles.headerPosition]} />
      <Pressable
        style={styles.createbtn}
        onPress={() => navigation.navigate("CreatePost")}
      >
        <Image
          style={styles.vectorIcon1}
          resizeMode="cover"
          source={require("../assets/Create.png")}
        />
      </Pressable>
    </View>
  );
};


const styles = StyleSheet.create({
  flatListFlatListContent: {
    flexDirection: "column",
    marginTop: 3,
  },
  userProfile:{
    // position:'absolute', 
    zIndex: 2, top: 65, left: 10,
    flexDirection: 'row',
  },
  userProfileImage:{
    width: 30, height: 30,
  },
  names:{
    flexDirection: 'column', marginLeft: 10,
  },
  uname:{
    fontSize: 14, fontWeight: 500,
  },
  feedFlexBox: {
    flex: 1,
    overflow: "hidden",
  },
  headerPosition: {
    left: 0,
    position: "absolute",
  },
  vectorIconLayout: {
    height: 20,
    width: 20,
  },
  flatList: {
    marginTop: 3,
    overflow: "hidden",
  },
  scrollview: {
    top: 101,
    height: 688,
    alignItems: "center",
  },
  bottomview: {
    top: 788,
  },
  vectorIcon1: {
    bottom: 80, right: 20,
    width: 50,
    height: 50,
  },
  createbtn: {
    top: 718,
    left: 311,
    padding: Padding.p_3xs,
    position: "absolute",
  },
  header: {
    top: 0,
  },
  feed: {
    backgroundColor: "#f8f8f8",
    width: "100%",
    height: 852,
    overflow: "hidden",
  },
});

export default Feed;
